Storyline:

    Star photographer Russel Price (Nolte) covers the civil war against president Somoza. Facing the cruel fighting - people versus army - it's often hard for him to stay neutral. When the Guerillas have him take a picture of the leader Rafael, who's believed to be dead, he gets drawn into the happenings. Together with his reporter friends Claire (Cassidy) and Alex (Hackman) he has to hide from the Nicaraguan army.



